import React, { useState, useEffect } from "react";
import { NavLink } from "react-router-dom";
const Offer = () => {
  const [btnData, setBtnData] = useState("punjabi");
  const [record, setRecord] = useState([]);
  useEffect(() => {
    const filterData = DataMenu.filter((data) => {
      return btnData == data.category
    })

    setRecord(filterData);

  }, [btnData])
  return (
    <>
      <section className="offer-section">
        <div className="container">
          <div className="row">
            <div className="border flex">
              <div className="sub-border"></div>
              <div className="sub-border"></div>
              <div className="sub-border"></div>
              <div className="sub-border"></div>
              <div className="sub-border"></div>
            </div>
            <div className="content">
              <div className="heading">
                <span>Annapurana tasty offer</span>
                <h1>our menu</h1>
              </div>
              <div className="main-cart flex">
                <div className="cart">
                {
                      record && record.map((val) => {
                        const { id, price, name, parimageagraph } = val
                        return (
                          <li key={id}>
                            <div className="title flex">
                              <h2>{name}</h2><span>₹{price}</span>
                              {/* <p>{paragraph}</p> */}
                            </div>
                          </li>
                        )
                      })
                    }
                  <div className="content">
                    <div className="image">
                      <div className="btn flex">
                        <NavLink>Order</NavLink>
                      </div>
                      <img src="./Image\AdobeStock_446859522_Preview.jpeg" alt="" />
                    </div>
                    <div className="details flex">
                      <h5>chinese</h5>
                      <ul className="flex">
                        <li><i class="fa-solid fa-star"></i></li>
                        <li><i class="fa-solid fa-star"></i></li>
                        <li><i class="fa-solid fa-star"></i></li>
                        <li><i class="fa-solid fa-star"></i></li>
                        <li><i class="fa-solid fa-star"></i></li>
                      </ul>
                      <p>noodels</p><span>₹150</span>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
}
export default Offer;
